import React from 'react';
import {Navlink} from 'react-router-dom';

const NavBar = () => (
  <nav className="flex justify-between bb b--light-green bg-light-green shadow-5">
    <a className="link dark-blue hover-blue no-underline flex items-center f1 pa3" href="">
      Welcome to the Blogger
    </a>
    <div className="flex-grow pa3 flex items-center">
      <a className="f5 dib blue bg-animate hover-bg-white hover-black no-underline pv2 ph4 br-pill ba b--blue-20" href="#0">Blogs</a>
      <a className="f5 dib blue bg-animate hover-bg-white hover-black pv2 no-underline ph4 br-pill ba b--white-20" href="#0">Create</a>
    </div>
  </nav>
);

export default NavBar;
